import React, { Fragment } from "react";

import { 
  Jumbotron, 
  Qoute, 
  Button, 
  Grid, 
  Row, 
  Column,
  Logo
} from "../bootstrap";

import {
  twitterLogo, 
  tumblerLogo
} from "../../resources/logos";

const qouteGenerator = props => {
    return (
      <Fragment>
        <Jumbotron title="Qoute of the day" width={"550px"}>
          <Qoute text={this.qoute.text} source={this.qoute.soure}>
            By
          </Qoute>

          <Grid>
            <Row>
              <Column>
                <Logo src={twitterLogo} link={"https://www.google.com/"}/>
                <Logo src={tumblerLogo} link={"https://www.google.com/"}/>
              </Column>

              <Column right>
                <Button name="New qoute"/>
              </Column>
            </Row>
          </Grid>     
        </Jumbotron>  
      </Fragment>  
    );
}

export default qouteGenerator;
